import React, { useState, useEffect } from 'react'

function App() {

  const [data, setData] = useState([{}]);

  useEffect(() => {
    fetch("/members").then(
      res => console.log(res)
    ).then(
      data => {
        setData(data);
        //console.log(data);
      }
    ).catch(
      error => console.log(error)
    )
  }, [])

  return (
    <div >
      <span>My new app</span>
    </div>
  );
}

export default App;
